import data from "./data/conanical_visits.json";
export default function Table({head, body }) {
  return (
    <table>
      <thead>
        <tr>
          {head.map((h, key) =>(
            <th key = {key}>{h}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>item 1</td>
          <td>item 2</td>
          <td>item 3</td>
        </tr>
      </tbody>
    </table>
  );
}
